import React, { useState, useEffect } from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

function Dashboard({ gameState, onStartRound, onRefresh }) {
  const [leaderboard, setLeaderboard] = useState([]);

  useEffect(() => {
    loadLeaderboard();
  }, [gameState]);

  const loadLeaderboard = async () => {
    try {
      const response = await fetch('/api/leaderboard');
      const data = await response.json();
      setLeaderboard(data);
    } catch (err) {
      console.error('Error loading leaderboard:', err);
    }
  };

  const getFlag = (countryId) => {
    const flags = {
      'Germany': 'üá©üá™',
      'USA': 'üá∫üá∏',
      'China': 'üá®üá≥',
      'Japan': 'üáØüáµ',
      'UK': 'üá¨üáß',
      'France': 'üá´üá∑'
    };
    return flags[countryId] || 'üè≥Ô∏è';
  };

  const chartData = gameState.history.map(h => ({
    round: h.round,
    BIP: Math.round(h.gdp),
    Arbeitslosigkeit: h.unemployment,
    Handelsbilanz: h.tradeSurplus
  }));

  return (
    <div className="container">
      <div className="header">
        <h1>üåç {gameState.playerCountry.name} Dashboard</h1>
        <p>Spieler: {gameState.playerName} | Runde: {gameState.round} | Punkte: {Math.round(gameState.score)}</p>
      </div>

      <div className="stat-grid">
        <div className="stat-box">
          <h4>BIP (Bruttoinlandsprodukt)</h4>
          <div className="value">${Math.round(gameState.playerCountry.gdp)} Mrd.</div>
          {gameState.history.length > 0 && (
            <div className={gameState.history[gameState.history.length - 1].gdp > 
              (gameState.history[gameState.history.length - 2]?.gdp || 0) ? 'change positive' : 'change negative'}>
              {gameState.history.length > 1 ? 
                `${Math.round(gameState.history[gameState.history.length - 1].gdp - 
                  gameState.history[gameState.history.length - 2].gdp)} Mrd.` : '-'}
            </div>
          )}
        </div>

        <div className="stat-box">
          <h4>Arbeitslosenquote</h4>
          <div className="value">{gameState.playerCountry.unemployment.toFixed(1)}%</div>
        </div>

        <div className="stat-box">
          <h4>Handelsbilanz</h4>
          <div className="value">
            ${gameState.playerCountry.tradeSurplus > 0 ? '+' : ''}
            {Math.round(gameState.playerCountry.tradeSurplus)} Mrd.
          </div>
        </div>

        <div className="stat-box">
          <h4>Steuersatz</h4>
          <div className="value">{gameState.playerCountry.taxRate}%</div>
        </div>

        <div className="stat-box">
          <h4>Zollsatz</h4>
          <div className="value">{gameState.playerCountry.tariffRate}%</div>
        </div>

        <div className="stat-box">
          <h4>Gesamtpunkte</h4>
          <div className="value">{Math.round(gameState.score)}</div>
        </div>
      </div>

      {chartData.length > 0 && (
        <div className="card" style={{ marginTop: '30px' }}>
          <h3>üìà Wirtschaftliche Entwicklung</h3>
          <ResponsiveContainer width="100%" height={300}>
            <LineChart data={chartData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="round" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Line type="monotone" dataKey="BIP" stroke="#667eea" strokeWidth={2} />
              <Line type="monotone" dataKey="Handelsbilanz" stroke="#4facfe" strokeWidth={2} />
            </LineChart>
          </ResponsiveContainer>
        </div>
      )}

      <div className="ai-countries">
        <h3>üåê Internationale Beziehungen</h3>
        {gameState.aiCountries.map(country => (
          <div key={country.id} className="ai-country">
            <h4>{getFlag(country.id)} {country.name}</h4>
            <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(150px, 1fr))', gap: '10px', fontSize: '0.9em' }}>
              <div>BIP: ${Math.round(country.gdp)} Mrd.</div>
              <div>Arbeitslosigkeit: {country.unemployment.toFixed(1)}%</div>
              <div>Zollsatz: {country.tariffRate}%</div>
            </div>
            <div style={{ marginTop: '10px' }}>
              <small>Beziehung: {Math.round(country.relationship)}/100</small>
              <div className="relationship-bar">
                <div 
                  className="relationship-fill" 
                  style={{ width: `${country.relationship}%` }}
                />
              </div>
            </div>
          </div>
        ))}
      </div>

      {leaderboard.length > 0 && (
        <div className="leaderboard">
          <h3>üèÜ Bestenliste</h3>
          <table>
            <thead>
              <tr>
                <th>Rang</th>
                <th>Spieler</th>
                <th>Land</th>
                <th>Runde</th>
                <th>Punkte</th>
              </tr>
            </thead>
            <tbody>
              {leaderboard.map((entry, index) => (
                <tr key={entry.gameId} style={{ 
                  background: entry.gameId === gameState.id ? '#e7f3ff' : 'transparent',
                  fontWeight: entry.gameId === gameState.id ? 'bold' : 'normal'
                }}>
                  <td>{index + 1}</td>
                  <td>{entry.playerName}</td>
                  <td>{entry.country}</td>
                  <td>{entry.round}</td>
                  <td>{Math.round(entry.score)}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}

      {gameState.history.length > 0 && (
        <div className="feedback-section">
          <h3>üìã Letztes Feedback</h3>
          <ul>
            {gameState.history[gameState.history.length - 1].feedback.map((msg, idx) => (
              <li key={idx}>{msg}</li>
            ))}
          </ul>
        </div>
      )}

      <div style={{ marginTop: '30px', textAlign: 'center', display: 'flex', gap: '15px', justifyContent: 'center' }}>
        <button className="btn btn-success" onClick={onStartRound}>
          N√§chste Runde starten ‚ñ∂Ô∏è
        </button>
        <button className="btn btn-secondary" onClick={onRefresh}>
          Aktualisieren üîÑ
        </button>
      </div>
    </div>
  );
}

